

function getIconClassName(name){
    let pos = 0;
    let temp = [];
    let temp2 = [];
    let temp3 = [];
    let icon_types = ["fa-thin ", "fa-solid ", "fa-regular ", "fa-light ", "fa-duotone "];
    let className = "";
    let loopFunc = function(data){
        if(classes.indexOf(data) > -1){
            let unique, random;

            while(true){
                let foundPos = classes.indexOf(data, pos);
                let cnt = 0;
                let dec = 0;
                let word = "";
        
                if(foundPos == -1) break;
        
                pos = foundPos + 1;
        
                while(classes.charAt(foundPos) != "."){
                    dec++;
                    foundPos--;
                }
                while(classes.charAt(foundPos) != ":"){                    
                    cnt++;
                    word = word + classes.charAt(foundPos++);
                }

                temp.push(word.replace(".", ""));

                const set = new Set(temp);
                unique = [...set];
            }
            let result = "";;
            random = Math.floor(Math.random() * temp3.length);

            unique.forEach(function(item1){
                let str = item1.replace("fa-", "");
                temp2 = str.split("-");
                temp2.forEach(function(item2){
                    if(item2 === data) temp3.push(item1);
                });
            });

            for(let i = 0; i < temp3.length; i++){
                if(temp3[i] === "fa-" + data && result === ""){
                    className = icon_types[0] + temp3[i];
                    result = "exact";
                }
            }
            if(result !== "exact") className = icon_types[0] + temp3[random];
        }else{

            className = undefined;
        }
    }

    loopFunc(name);

    let error_names;
    let cnt = 0;

    if(!className){
        error_names = name.split(" ");

        for(let i = 0; i < error_names.length; i++){
            if(cnt === 0){
                loopFunc(error_names[i]);
                if(className) cnt++;
            }
        }
    }else{
        cnt++;
    }
    if(cnt === 0) className = undefined;

    // console.log(`■■■■■■■■■■■■■■■■■■■■■■■■■■■ RESULT: ${className} ■■■■■■■■■■■■■■■■■■■■■■■■■■■`);
    return className;
}

